const UserData = (props) => {
  return (
    <div className="centered">
      <h3>Name: {props.name}</h3>
      <br />
      <hr />
      <h4>Roll No.: {props.rollno}</h4>
      <br />
      <h4>Branch: {props.branch}</h4>
      <br />
    </div>
  );
};
export default UserData;
